import React from 'react'
import StickyFooter from 'react-sticky-footer'
import {Jumbotron } from 'react-bootstrap'

class Footer extends React.Component {
    render(){
        return(
            <div>
                <Jumbotron>
                    <StickyFooter
                        bottomThreshold={300}
                        normalStyles={{
                        backgroundColor: "black",
                        padding: "10rem"
                        }}
                        stickyStyles={{
                        backgroundColor: "rgba(255,255,255,.8)",
                        padding: "10rem"
                        }}
                    >
                    *

Electronics and Communication Engineering Department, G H Patel College of Engineering, Vallabh Vidyanagar, India

*Corresponding Author:
    Rahul K. Kher
    Electronics and Communication Engineering Department
    G H Patel College of Engineering
    Vallabh Vidyanagar, India
    Tel: 02692 231 651
    E-mail: rahul2777@gmail.com

Received Date: June13, 2016; Accepted Date: July 01, 2016; Published Date: July 10, 2016

Citation: Kher RK. Mobile and E-Healthcare: Recent Trends and Future Directions. J Health Med Econ. 2016, 2:10 doi:10.21767/2471-9927.100010

Copyright: Â© 2016 Rahul K. Kher. This is an open-access article distributed under the terms of the Creative Commons Attribution License,which permits unrestricted use, distribution, and reproduction in any medium, provided the original author and source are credited.
                    </StickyFooter>                    
                </Jumbotron>
            </div>
        );
    }
}
export default Footer;
